    </div>
    <div className="customerReview">
    {customerReviewList.map((item)=>{
      return  <CustomerReview
        key={item.key}
        content={item.content}
        image={item.image}
        name={item.name}
        />

    })}

    
    </div>
    </>
}

export default Customer;
